import Link from 'next/link';

const HomePage = () => {
    return (
        <div className='container'>
            <div className='topbar'>
                <div className='logo-container'>
                    logo
                </div>
                <div className='logo-container'>
                    <div>Products</div>
                    <div>Manage</div>
                    <div>Profile</div>
                </div>
            </div>
          
            <style jsx global>{`
            @font-face{
                font-family: Roboto;
                src:url(/static/font/Serithai-Regular.ttf);
            }
                :global(body){
                        magin:0;
                }
               
                .topbar{
                    display : flex;
                    //flex-direction: column;
                    justify-content:space-between;
                    align-item: center;
                    height: 32px;
                    background-color:red;
                    padding: 0 40px;
                }   
                .menu-container{
                    display :flex;
                    flex-direction:row;
                }
                .menu-container div{
                    margin-left: 5px;
                }      
            `}</style>
        </div>
    )
}

export default HomePage;
